import React from "react";
import "../produce/dashboard.css";

function Dashboard() {
  return (
    <>
      <div className="wrapper">
        <div className="sidebar"></div>
        <div className="dashboard"></div>
      </div>
    </>
  );
}

export default Dashboard;
